import merchant from "../fixtures/merchant.json"
import manajer from "../fixtures/manajer.json"

class ProjectsPage {

    createProject() {  // Create Project and Install the Can use cardtoken checkbox
        // Get time
        let today = new Date();
        if (today.getMinutes () <10) {
        let time = today.getHours () + '_0' + today.getMinutes ()+ '_' + today.getSeconds();}
             let time = today.getHours () + '_'  + today.getMinutes () + '_' + today.getSeconds();

        // Create Project
        cy.request({
            method: 'POST',
            url: `https://app.stage.paydo.com/v1/apps/create`,
            headers: {
                token: merchant.token,
            },
            body: {
                "name": "MyNewProject" + " " + time,
                "info": "non-specialized wholesale trade",
                "site": "https://app.stage.paydo.com/my.new.project" + time,
                "ipn": "https://non-specialized wholesale trade",
                "logo": "data:image/jpeg;base64,",
                "logoSrc": "data:image/jpeg;base64,",
                "amountInfo": {
                    "minAmount": {
                        "value": 0.01,
                        "currency": "EUR"
                    },
                    "averageAmount": {
                        "value": 1000,
                        "currency": "EUR"
                    },
                    "maxAmount": {
                        "value": 10000,
                        "currency": "EUR"
                    },
                    "expectedVolume": {
                        "value": 10000,
                        "currency": "EUR"
                    }
                },
                "checkoutPageCustomization": {
                    "logoSrc": "data:image/jpeg;base64,"
                }
            }
        }).then((response) => {
                 expect(response).property('status').to.equal(201);

                 // Get identifier last project
                cy.request({
                    method: 'GET',
                    url: "https://app.stage.paydo.com/v1/apps/filters?query[userIdentifier]="+merchant.bussiness_account,
                    headers: {
                        token: manajer.token
                    }
                }).then((response) => {
                    expect(response).property('status').to.equal(200);
                    expect(response.body).property('data').to.not.be.oneOf([null, ""]);
                    let projident = response.body.data[0].identifier;

                    // Install the Can use cardtoken checkbox
                    cy.request({
                        method: 'POST',
                        url: "https://app.stage.paydo.com/v1/apps/"+projident+"/update-manager",
                        headers: {
                            token: manajer.token,
                        },
                        body: {
                            "name": "MyNewProject" + " " + time,
                            "info": "non-specialized wholesale trade",
                            "site": "https://app.stage.paydo.com/my.new.project"+time,
                            "ipn": "https://non-specialized wholesale trade",
                            "canUseCardToken": true,
                            "cashRegisterType": "default",
                            "midIdentifier": 0,
                            "logo": "data:image/jpeg;base64,",
                            "newStatus": null,
                            "logoSrc": "data:image/jpeg;base64,",
                            "amountInfo": {
                                "minAmount": {
                                    "value": 0.01,
                                    "currency": "EUR"
                                },
                                "averageAmount": {
                                    "value": 1000,
                                    "currency": "EUR"
                                },
                                "maxAmount": {
                                    "value": 10000,
                                    "currency": "EUR"
                                },
                                "expectedVolume": {
                                    "value": 10000,
                                    "currency": "EUR"
                                }
                            },
                            "checkoutPageCustomization": {
                                "logoSrc": "data:image/jpeg;base64,"
                            }
                        }
                    }).then((response) => {
                        expect(response).property('status').to.equal(201)
                    })
                })
        })
    }


    acceptProject() {
        // Get identifier last project
        cy.request({
            method: 'GET',
            url: "https://app.stage.paydo.com/v1/apps/filters?query[userIdentifier]="+merchant.bussiness_account,
            params: {
                "query[userIdentifier]": merchant.bussiness_account
            },
            headers: {
                token: manajer.token
            }
        }).then((response) => {
            expect(response).property('status').to.equal(200);
            expect(response.body).property('data').to.not.be.oneOf([null, ""]);
            let projident = response.body.data[0].identifier;

            // Accept project
            cy.request({
                method: 'POST',
                url: "https://app.stage.paydo.com/v1/apps/" + projident + "/accept",
                params: {
                    "query[userIdentifier]": merchant.bussiness_account // нужны ли здесь параметры?
                },
                headers: {
                    token: manajer.token
                }
            }).then((response) => {
                expect(response).property('status').to.equal(200);
                expect(response.body).property('data').to.not.be.oneOf([null, ""]);

            })
        })
    }
}

export default new ProjectsPage();